import React from 'react'
import TeamMember from './TeamMember'

function Team() {
    const pi = [
        {id: 0, img: './khaled1.jpg', name: 'Nour Homsi',     position: 'Graphic Designer',          phone: ' ',             website: 'www.esedu.fi',},
        {id: 1, img: './khaled2.jpg', name:'Khaled Alkilani', position: 'Junior Software Developer', phone: '045 207 8489',  website: 'www.esedu.fi',},
        {id: 2, img: './khaled1.jpg', name: 'Captin Majed',   position: 'IT Engineer',               phone: '044 550 8467'},
    ]

    const members = pi.map(member => <TeamMember
                            key={member.id}
                            img={member.img}
                            name={member.name}
                            position={member.position}
                            phone={member.phone}
                            website={member.website}
                        />);
// console.log(`<TeamMember ${member.position} />`);

    return(
        <div className='row'>
        {members}
        </div>
    )
}

export default Team
